import React, { useState } from 'react';
import './App.css';
import ListOfGifs from './components/ListOfGifs';
import { Route } from 'wouter';

function App() {
  return (
    <div  className="App">
      <section className="App-content">
        <h1>App</h1>
        <a href='/gif/panda'>Gifs de pandas</a>
        <Route 
          component={ListOfGifs}
          path="/gif/:keyword"
        />

      </section>
    </div>
  );
}

export default App;
